TWComponent.script:
if (tw.local.error){
tw.local.statusMessage += "Error: Not Deleted " + tw.local.ECMDocuments.listLength + " Documents " +  tw.local.error.errorCode + tw.local.error.errorText + new TWDate();
}else {
tw.local.statusMessage += "Success: Deleted " + tw.local.ECMDocuments.listLength + " Documents " + new TWDate();

}

if (tw.system.error){
tw.local.statusMessage = "Error: Exception while deleting Documents "  + tw.system.error.toString(true) + new TWDate();
}else {
tw.local.statusMessage = "Error: Unknow Error while deleting Documents" + new TWDate();

}

